import React from 'react'
const navBar=()=>{
    return(
        <div>
            <nav>
                <ul>
                    <li><a href="Home">Home</a></li>
                    <li><a href="Address">Address</a></li>
                
                </ul>
            </nav>
        </div>
    )
}
